import React, { Component } from "react";
import '../styles/App.css';

import Youtube from '../apis/Youtube';
import SearchBar from './SearchBar';
import VideoList from './VideoList';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      videos: [{id:1},{id:2}],
    }
  }

  render() {
    console.info('App render');
    return (
      <div className='App container' style={{ marginTop: '10px'}}>
        <div className='row'>
          <div className='col'>
            <SearchBar handleFormSubmit={this.handleSubmit}></SearchBar>
            <div className='row'>
              <div className='col-8' style={{ backgroundColor: 'gray' }}>
                유튜브 플레이 위치
              </div>
              <div className='col-4' style={{ backgroundColor: 'whitesmoke' }}>
                <VideoList videos={this.state.videos}></VideoList>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
